(81, 1, '2022-09-26 16:25:19', '2022-09-26 13:25:19', '<p class=\"consultation__form_header\">Запишитесь на консультацию!</p>\r\n<p class=\"consultation__form_descr\">Мы свяжемся с вами в ближайшее время</p>\r\n<label class=\"consultation__form_label\"> Введите Ваше имя</label>\r\n<p class=\"consultation__form_whitespace\"></p>\r\n    [text* text-956 class:consultation__form_name placeholder \"Ваше имя\"] \r\n\r\n<label class=\"consultation__form_label\"> Введите ваш номер телефона</label>\r\n<p class=\"consultation__form_whitespace\"></p>\r\n    [tel* tel-67 class:consultation__form_tel placeholder \"+375 (__) ___-__-__\"] \r\n\r\n[submit class:consultation__form_submit \"Получить консультацию\"]\r\n\r\n<p  class=\"consultation__form_label consultation__form_agree\">Нажимая на кнопку вы даете свое согласие на обработку ваших персональных данных</p>\n1\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@herbalife>\n[_site_admin_email]\nОт: [your-name] <[your-email]>\r\nТема: [your-subject]\r\n\r\nСообщение:\r\n[your-message]\r\n\r\n-- \r\nЭто сообщение отправлено с сайта [_site_title] ([_site_url])\nReply-To: [your-email]\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@herbalife>\n[your-email]\nСообщение:\r\n[your-message]\r\n\r\n-- \r\nЭто сообщение отправлено с сайта [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nСпасибо за Ваше сообщение. Оно успешно отправлено.\nПри отправке сообщения произошла ошибка. Пожалуйста, попробуйте ещё раз позже.\nОдно или несколько полей содержат ошибочные данные. Пожалуйста, проверьте их и попробуйте ещё раз.\nПри отправке сообщения произошла ошибка. Пожалуйста, попробуйте ещё раз позже.\nВы должны принять условия и положения перед отправкой вашего сообщения.\nВажно заполнить это поле.\nВ это поле вставлен слишком большой объем данных.\nВ это поле вставлен слишком малый объем данных.\nПри загрузке файла произошла неизвестная ошибка.\nВам не разрешено загружать файлы этого типа.\nЗагруженный файл слишком большой.\nПри загрузке файла произошла ошибка.\nВведите дату в формате ГГГГ-ММ-ДД.\nВ это поле введена слишком ранняя дата.\nВ это поле введена слишком поздняя дата.\nВведите число.\nВ это поле введено слишком маленькое число.\nВ это поле введено слишком большое число.\nНеверный ответ на проверочный вопрос.\nВведите адрес электронной почты.\nВведите URL.\nВведите номер телефона.', 'Консультация_copy', '', 'publish', 'closed', 'closed', '', 'forma-obratnoj-svyazi-dlya-bloka-konsultaczii_copy', '', '', '2022-09-26 16:27:20', '2022-09-26 13:27:20', '', 0, 'http://herbalife/?post_type=wpcf7_contact_form&#038;p=81', 0, 'wpcf7_contact_form', '', 0),
